            var bearer = `Bearer ${token}`;
            console.log(bearer);
            const fet = await fetch('http://localhost:4000/api/users',{
                method: "GET",
                headers: {
                    "Authorization": bearer
                },
                credentials: "include"
            })
            const res = await fet;
            console.log(res);
            setData(res);
        }
        fetchData();
    }, [])
    
